/// Generate a 3D model from an image.
/// 
/// This is an alpha endpoint. It will change in the future. The current output is honestly pretty bad. So if you find this endpoint, you get what you pay for, which currently is nothing. But in the future will be made a lot better.
/// 
/// **Parameters:**
/// 
/// - `input_format: crate::types::ImageType`: The format of the image being converted. (required)
/// - `output_format: crate::types::FileExportFormat`: The format the output file should be converted to. (required)
async fn example_ai_create_image_to_3d() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::Mesh = client
        .ai()
        .create_image_to_3d(
            kittycad::types::ImageType::Jpg,
            kittycad::types::FileExportFormat::Stl,
            &bytes::Bytes::from("some-string"),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}

