/// Submit one drawing operation.
/// 
/// Response depends on which command was submitted, so unfortunately the OpenAPI schema can't generate the right response type.
use std::str::FromStr;
async fn example_drawing_cmd() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: serde_json::Value = client
        .drawing()
        .cmd(&kittycad::types::DrawingCmdReq {
            cmd: kittycad::types::DrawingCmd::DrawingCmd(kittycad::types::DrawingCmd {
                extrude: kittycad::types::Extrude {
                    distance: 3.14 as f64,
                    sketch: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
                },
            }),
            cmd_id: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
            file_id: "some-string".to_string(),
        })
        .await?;
    println!("{:?}", result);
    Ok(())
}

/// Submit many drawing operations.
use std::str::FromStr;
async fn example_drawing_cmd_batch() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::DrawingOutcomes = client
        .drawing()
        .cmd_batch(&kittycad::types::DrawingCmdReqBatch {
            cmds: std::collections::HashMap::from([(
                "some-key".to_string(),
                kittycad::types::DrawingCmdReq {
                    cmd: kittycad::types::DrawingCmd::DrawingCmd(kittycad::types::DrawingCmd {
                        extrude: kittycad::types::Extrude {
                            distance: 3.14 as f64,
                            sketch: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
                        },
                    }),
                    cmd_id: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
                    file_id: "some-string".to_string(),
                },
            )]),
            file_id: "some-string".to_string(),
        })
        .await?;
    println!("{:?}", result);
    Ok(())
}

