/// Convert CAD file.
/// 
/// Convert a CAD file from one format to another. If the file being converted is larger than 25MB, it will be performed asynchronously.
/// If the conversion is performed synchronously, the contents of the converted file (`output`) will be returned as a base64 encoded string.
/// If the operation is performed asynchronously, the `id` of the operation will be returned. You can use the `id` returned from the request to get status information about the async operation from the `/async/operations/{id}` endpoint.
/// 
/// **Parameters:**
/// 
/// - `output_format: crate::types::FileExportFormat`: The format the file should be converted to. (required)
/// - `src_format: crate::types::FileImportFormat`: The format of the file to convert. (required)
async fn example_file_create_conversion() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::FileConversion = client
        .file()
        .create_conversion(
            kittycad::types::FileExportFormat::Obj,
            kittycad::types::FileImportFormat::Obj,
            &bytes::Bytes::from("some-string"),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}

