/// Start an OAuth 2.0 Device Authorization Grant.
/// 
/// This endpoint is designed to be accessed from an *unauthenticated* API client. It generates and records a `device_code` and `user_code` which must be verified and confirmed prior to a token being granted.
use std::str::FromStr;
async fn example_oauth2_device_auth_request() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    client
        .oauth2()
        .device_auth_request(&kittycad::types::DeviceAuthRequestForm {
            client_id: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
        })
        .await?;
    Ok(())
}

/// Confirm an OAuth 2.0 Device Authorization Grant.
/// 
/// This endpoint is designed to be accessed by the user agent (browser), not the client requesting the token. So we do not actually return the token here; it will be returned in response to the poll on `/oauth2/device/token`.
async fn example_oauth2_device_auth_confirm() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    client
        .oauth2()
        .device_auth_confirm(&kittycad::types::DeviceAuthVerifyParams {
            user_code: "some-string".to_string(),
        })
        .await?;
    Ok(())
}

/// Request a device access token.
/// 
/// This endpoint should be polled by the client until the user code is verified and the grant is confirmed.
use std::str::FromStr;
async fn example_oauth2_device_access_token() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    client
        .oauth2()
        .device_access_token(&kittycad::types::DeviceAccessTokenRequestForm {
            client_id: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
            device_code: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
            grant_type: kittycad::types::Oauth2GrantType::UrnIetfParamsOauthGrantTypeDeviceCode,
        })
        .await?;
    Ok(())
}

/// Verify an OAuth 2.0 Device Authorization Grant.
/// 
/// This endpoint should be accessed in a full user agent (e.g., a browser). If the user is not logged in, we redirect them to the login page and use the `callback_url` parameter to get them to the UI verification form upon logging in. If they are logged in, we redirect them to the UI verification form on the website.
/// 
/// **Parameters:**
/// 
/// - `user_code: &'astr`: The user code. (required)
async fn example_oauth2_device_auth_verify() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    client.oauth2().device_auth_verify("some-string").await?;
    Ok(())
}

